import React from 'react'
import "./CreateDocs.css"
const CreateDocs = () => {
  return (
    <div className='body'>
        <div className='heading'>
            <h2 className='title'>Start a new Document</h2>
        </div>
    </div>
  ) 
}

export default CreateDocs
